import React from 'react';
import ReactDOM from 'react-dom/client';
import "./index.css";

function App(){
  return(
    <main className='card'>
      <Avatar />
      <Content />
      <Buttons name="HTML" color="red"/>
      <Buttons name="CSS" color="blue"/>
      <Buttons name="JavaScript" color="yellow"/>
    </main>
  )
}


function Avatar(){
  return(
    <img className="avatar" src="./profile.jpg" alt='profile' />
  )
}

function Content(){
  return(
    <p className='bd-text'>Full-stack web developer and teacher at Udemy. When not coding or preparing a course, I like to play board games, to cook (and eat), or to just enjoy the Portuguese sun at the beach.</p>
  )
}

function Buttons(props){
  return(
    <div>
      <button className={props.color}>{props.name}</button>
    </div>
  )
}

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);
